import React from "react";
import "./trainning.css";

import { FaRegHandPointRight } from "react-icons/fa";
function Trainning() {
  return (
    <div className="content-container">
      <div className="trainningContent-container">
        <div className="leftTrainningContent">
          <div className="title">
            <h1 className="primaryTitle2-white">Come and be Trained in </h1>
            <div className="content">
              <div>
                <span>
                  <FaRegHandPointRight className="trainingIcon" />
                </span>{" "}
                Aviation Management/IATA/ICAO
              </div>
              <div>
                <span>
                  <FaRegHandPointRight className="trainingIcon" />
                </span>{" "}
                Monitoring & Evaluation/ ICT
              </div>
              <div>
                <span>
                  <FaRegHandPointRight className="trainingIcon" />
                </span>{" "}
                Hospitality
              </div>
              <div>
                <span>
                  <FaRegHandPointRight className="trainingIcon" />
                </span>{" "}
                Tourism
              </div>
            </div>
          </div>
        </div>
        <div className="rightContentContainer">
          <div className="title">
            <h1 className="primaryTitle2-white">Other Services</h1>
            <div className="content2">
              <div>
                <span>
                  <FaRegHandPointRight className="trainingIcon" />
                </span>{" "}
                Air ticket booking
              </div>
              <div>
                <span>
                  <FaRegHandPointRight className="trainingIcon" />
                </span>{" "}
                Visa assistance
              </div>
              <div>
                <span>
                  <FaRegHandPointRight className="trainingIcon" />
                </span>{" "}
                Tour package
              </div>
              <div>
                <span>
                  <FaRegHandPointRight className="trainingIcon" />
                </span>{" "}
                Consultancy
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Trainning;
